function getServerIp(id, token) {
    var decrypted = CryptoJS.AES.decrypt(token, id);
    try {
      var res = decrypted.toString(CryptoJS.enc.Utf8);
    }
    catch(err) { /* malformed URL */
      return ""
    }
    console.log("decrypted:", res);
    if (!res.includes("http")) {
        return "";
    } else {
        return res;
    }
}